import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { DateCalendar } from '@mui/x-date-pickers/DateCalendar';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DemoContainer, DemoItem } from '@mui/x-date-pickers/internals/demo';
import { ReactComponent as OrangeDot } from "../../assets/orange dot.svg";
import dayjs from 'dayjs';
import { Typography } from '@mui/material';
import styled from "styled-components";
import Divider from '@mui/material/Divider';

const StyledRemiderContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  gap: 0.5rem;

`

const BasicTabs= () => {
  const [value, setValue] = React.useState('1');

  const handleChange = (event: React.SyntheticEvent, newValue: string) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%', typography: 'body1' }}>
      <TabContext value={value}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
          <TabList onChange={handleChange} aria-label="lab API tabs example">
            <Tab label="Team" value="1" />
            <Tab label="Me" value="2" />
            {/* <Tab label=" " value="3" /> */}
          </TabList>
        </Box>

        <TabPanel value="1">
        <LocalizationProvider dateAdapter={AdapterDayjs}>
        <DemoContainer components={['DateCalendar']}>
        <DateCalendar defaultValue={dayjs(new Date().toISOString().substring(0, 10))} readOnly />
        </DemoContainer>
        </LocalizationProvider>
        <StyledRemiderContainer>
        <OrangeDot/>
        <Typography mt={3} padding={0} margin={0} >You have a total of 5 overdue cases.</Typography>
        </StyledRemiderContainer>
        <Box sx={{ p: 1 }}>
        <Divider />
        </Box>
        </TabPanel>
        <TabPanel value="2">Item Two</TabPanel>
        {/* <TabPanel value="3"></TabPanel> */}
      </TabContext>
    </Box>
  );
};

export default BasicTabs;
